import React from 'react';
import  s from './ProfileInfo.module.css'
import ava from '../../../img/dikush.jpeg'

const ProfileInfo = () => {
    return (<div>
        <div className={s.descriptionBlock}>
            <div><img src={ava} alt=""/></div>
        </div>
    </div>);
}

export default ProfileInfo;
